-- Advanced prediction settings
local predictionValue = 0.2
local magnetismFactor = 0.25

local trackingActive = false
local currentTarget = nil

-- Function to find the nearest player in front of the camera
local function findNearestPlayer()
    local ClosestDistance, ClosestPlayer = math.huge, nil
    local CenterPosition = Vector2.new(
        game:GetService("GuiService"):GetScreenResolution().X / 2,
        game:GetService("GuiService"):GetScreenResolution().Y / 2
    )

    for _, Player in ipairs(game:GetService("Players"):GetPlayers()) do
        if Player ~= LocalPlayer then
            local Character = Player.Character
            if Character and Character:FindFirstChild("HumanoidRootPart") and Character:FindFirstChild("Humanoid").Health > 0 then
                local Position, IsVisibleOnViewport = game:GetService("Workspace").CurrentCamera:WorldToViewportPoint(Character.HumanoidRootPart.Position)

                if IsVisibleOnViewport then
                    local Distance = (CenterPosition - Vector2.new(Position.X, Position.Y)).Magnitude
                    if Distance < ClosestDistance then
                        ClosestPlayer = Character.HumanoidRootPart
                        ClosestDistance = Distance
                    end
                end
            end
        end
    end

    return ClosestPlayer
end

-- Function to predict the target's future position
local function predictPosition(target, predictionTime)
    local rootPart = target
    if rootPart then
        local currentVelocity = rootPart.Velocity
        local predictedPosition = rootPart.Position + currentVelocity * predictionTime
        return predictedPosition
    end
    return nil
end

-- Function to smoothly follow the target with a magnetic effect
local function smoothFollow(target, prediction)
    local camera = game:GetService("Workspace").CurrentCamera
    RunService:BindToRenderStep("SmoothFollow", Enum.RenderPriority.Camera.Value, function()
        if trackingActive and target then
            local targetPosition = predictPosition(target, prediction)
            if targetPosition then
                local newPosition = camera.CFrame.Position:Lerp(targetPosition, magnetismFactor)
                camera.CFrame = CFrame.new(newPosition, targetPosition)
            end
        else
            RunService:UnbindFromRenderStep("SmoothFollow")
        end
    end)
end

-- Function to activate tracking
local function activateTracking()
    if not trackingActive then
        local nearestPlayer = findNearestPlayer()
        if nearestPlayer then
            trackingActive = true
            currentTarget = nearestPlayer
            smoothFollow(currentTarget, predictionValue)
        end
    end
end

-- Toggle tracking when the button is clicked
TextButton.Activated:Connect(function()
    if trackingActive then
        trackingActive = false
        TextButton.Text = "🧲"
    else
        activateTracking()
        TextButton.Text = "❌"
    end
end)
